import React, { useState, useEffect } from 'react';

const JobList = () => {
    const [jobs, setJobList] = useState([]);

    useEffect(() => {
        fetch('/search')
        .then(response => response.json())
        .then(data => {setJobList(data);});
    }, []);

    return (
        <div>
            <h1>List of Jobs</h1>
                {jobs.map(job => (
                    <div>
                        <table>
                            <tr key={job.id}>
                                <td>{job.id}</td>
                                <td>{job.username}</td>
                                <td>{job.animal}</td>
                            </tr>
                        </table>
                    </div>
                ))}
        </div>
    );
}

export default JobList;
